Accounts_CustomFields_Description:
Павінна быць дапушчальным JSON, дзе ключы з'яўляюцца імёнамі палёў, якія змяшчаюць слоўнік палявых умоў. Прыклад: <br/><code>{
"Роля": {
«Тып»: «выбраць»,
"DefaultValue": "студэнт",
"Варыянты": [ "настаўнік", "вучань"],
«Патрабуецца»: праўда,
"ModifyRecordField": {
«Масіў»: праўда,
«Поле»: «ролю»
}
},
"Шчэбет": {
«Тып»: «Тэкст»,
«Патрабуецца»: праўда,
"MINLENGTH": 2,
"MAXLENGTH": 10
}
}</code>

Custom_Translations_Description:
Павінна быць сапраўдным JSON, дзе ключы з'яўляюцца мовамі, якія змяшчаюць слоўнік ключа і перакладаў. Прыклад: <br/><code>{
"Ан": {
«Каналы»: «Нумары»
},
"Пт": {
«Каналы»: «Салас»
}
}</code>
